ian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0,\"contribute\":{\"captionsMetadataRenderer\":{\"addSubtitlesText\":{\"runs\":[{\"text\":\"Add subtitles\/CC\",\"navigationEndpoint\":{\"clickTrackingParams\":\"CAAQu2kiEwi1lJXG15HqAhVxr3sKHfP_DqY=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=QyeBxcvUJIU\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=QyeBxcvUJIU\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"QyeBxcvUJIU\",\"title\":\"The New Silk Road, Part 2: From Kyrgyzstan to Duisburg | DW Documentary\",\"lengthSeconds\":\"2546\",\"keywords\":[\"Documentary\",\"Documentaries\",\"documentaries\",\"DW documentary\",\"DW documentary 2019\",\"full documentary\",\"documentary 2019\",\"DW\",\"beyond the news\",\"New Silk Road\",\"China\",\"Kyrgyzstan\",\"Oman\",\"Europe\",\"belt and road\",\"belt and road documentary\",\"central asia\",\"belt and road documentary 2019\",\"kyrgyzstan\",\"duisburg\",\"oman\",\"marseille\",\"international trade\",\"international trade documentary\"],\"channelId\":\"UCW39zufHfsuGgpLviKh297Q\",\"isOwnerViewing\":false,\"shortDescription\":\"The New Silk Road is a mammoth project meant to connect China with the West. It’s a gigantic infrastructure project that Beijing says will benefit all. But this two-part documentary shows another side: of China’s self-interest and geopolitical ambitions.\\n\\nChina's path to global power leads through the legendary trade road. Our authors travel west on two separate paths: One team follows the sea route, along which China is expanding its support bases, while the other follows the ancient Silk Road through Central Asia. Their journey takes them through stunning landscapes and to magical places with ancient caravanserais, where the lore of the old Silk Road lives on. At the same time, they observe China’s overwhelming new influence in immense construction sites and shipping hubs. People everywhere are hoping the new trade will bring them and their children work and prosperity, just as the old Silk Road did hundreds of years ago. But others fear that a future dominated by China will bring them no good at all. \\\"Clean water, the mountains and nature are much more important than the money they give us,\\\" the filmmakers learn in Kyrgyzstan. Chinese investment has not only bestowed the country with better roads, power lines and railway lines, but also with environmental pollution, corruption and crippling debt. Oman is another stop on the line, where Beijing has taken over large parts of a new Special Economic Zone in the desert city of Duqm. You can still see traditional Arab dhows in the old harbor at Sur, but they no longer have a place in today’s international trade. Instead, the horizon is dotted with huge container ships, many of them flying the Chinese flag. Meanwhile, the French port city of Marseille is aiming to become the New Silk Road’s European bridgehead. A small container village in the hills above the city is the first step. Cheap textiles from the Far East are delivered here to the \\\"Marseille International Fashion Center”. MIF 68 for short - 68 is considered a lucky number in China - is geared towards distributing China’s products throughout Europe. The two-part documentary shows the breathtaking dimensions of this gigantic project - one where, it would seem, no stone will be left unturned.\\n\\n-------------------------------------------------------------------- e construction sites and shipping hubs. People everywhere are hoping the new trade will bring them and their children work and prosperity, just as the old Silk Road did hundreds of years ago. But others fear that a future dominated by China will bring them no good at all. \\\"Clean water, the mountains and nature are much more important than the money they give us,\\\" the filmmakers learn in Kyrgyzstan. Chinese investment has not only bestowed the country with better roads, power lines and railway lines, but also with environmental pollution, corruption and crippling debt. Oman is another stop on the line, where Beijing has taken over large parts of a new Special Economic Zone in the desert city of Duqm. You can still see traditional Arab dhows in the old harbor at Sur, but they no longer have a place in today’s international trade. Instead, the horizon is dotted with huge container ships, many of them flying the Chinese flag. Meanwhile, the French port city of Marseille is aiming to become the New Silk Road’s European bridgehead. A small container village in the hills above the city is the first step. Cheap textiles from the Far East are delivered here to the \\\"Marseille International Fashion Center”. MIF 68 for short - 68 is considered a lucky number in China - is geared towards distributing China’s products throughout Europe. The two-part documentary shows the breathtaking dimensions of this gigantic project - one where, it would seem, no stone will be left unturned.\\n\\n--------------------------------------------------------------------\\n\\nDW Documentary gives you knowledge beyond the headlines. Watch high-class documentaries from German broadcasters and international production companies. Meet intriguing people, travel to distant lands, get a look behind the complexities of daily life and build a deeper understanding of current affairs and global events. Subscribe and explore the world around you with DW Documentary.\\n\\nSubscribe to DW Documentary:\\nh },"description":{"runs":[{"text":"The New Silk Road is a mammoth project meant to connect China with the West. It’s a gigantic infrastructure project that Beijing says will benefit all. But this two-part documentary shows another side: of China’s self-interest and geopolitical ambitions.\n\nChina's path to global power leads through the legendary trade road. Our authors travel west on two separate paths: One team follows the sea route, along which China is expanding its support bases, while the other follows the ancient Silk Road through Central Asia. Their journey takes them through stunning landscapes and to magical places with ancient caravanserais, where the lore of the old Silk Road lives on. At the same time, they observe China’s overwhelming new influence in immense construction sites and shipping hubs. People everywhere are hoping the new trade will bring them and their children work and prosperity, just as the old Silk Road did hundreds of years ago. But others fear that a future dominated by China will bring them no good at all. \"Clean water, the mountains and nature are much more important than the money they give us,\" the filmmakers learn in Kyrgyzstan. Chinese investment has not only bestowed the country with better roads, power lines and railway lines, but also with environmental pollution, corruption and crippling debt. Oman is another stop on the line, where Beijing has taken over large parts of a new Special Economic Zone in the desert city of Duqm. You can still see traditional Arab dhows in the old harbor at Sur, but they no longer have a place in today’s international trade. Instead, the horizon is dotted with huge container ships, many of them flying the Chinese flag. Meanwhile, the French port city of Marseille is aiming to become the New Silk Road’s European bridgehead. A small container village in the hills above the city is the first step. Cheap textiles from the Far East are delivered here to the \"Marseille International Fashion Center”. MIF 68 for short - 68 is considered a lucky number in China - is geared towards distributing China’s products throughout Europe. The two-part documentary shows the breathtaking dimensions of this gigantic project - one where, it would seem, no stone will be left unturned.\n\n--------------------------------------------------------------------\n\nDW Documentary gives you knowledge beyond the headlines. Watch high-class documentaries from German broadcasters and international production companies. Meet intriguing people, travel to distant lands, get a look behind the complexities of daily life and build a deeper understanding of current affairs and global events. Subscribe and explore the world around you with DW Documentary.\n\nSubscribe to DW Documentary:\n"},{"text":"https://www.youtube.com/channel/UCW39...","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMI_JWVxteR6gIV5MsRCB03mwPTSIXJ0N7cuOCTQw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/channel/UCW39zufHfsuGgpLviKh297Q?sub_confirmation=1#","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/channel/UCW39zufHfsuGgpLviKh297Q?sub_confirmation=1#","nofollow":true}}},{"text":"\n\nOur other YouTube channels:\nDW Documental (in spanish):  "},{"text":"https://www.youtube.com/dwdocumental","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMI_JWVxteR6gIV5MsRCB03mwPTSIXJ0N7cuOCTQw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/dwdocumental","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/dwdocumental","nofollow":true}}},{"text":"\nDW Documentary وثائقية دي دبليو: (in arabic): "},{"text":"https://www.youtube.com/dwdocarabia","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMI_JWVxteR6gIV5MsRCB03mwPTSIXJ0N7cuOCTQw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/dwdocarabia","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/dwdocarabia","nofollow":true}}},{"text":"\n\nFor m "simpleText":"Zulu"}}],"defaultAudioTrackIndex":0,"contribute":{"captionsMetadataRenderer":{"addSubtitlesText":{"runs":[{"text":"Add subtitles/CC","navigationEndpoint":{"clickTrackingParams":"CAAQu2kiEwi1lJXG15HqAhVxr3sKHfP_DqY=","commandMetadata":{"webCommandMetadata":{"url":"/timedtext_video?ref=watch\u0026v=QyeBxcvUJIU","rootVe":83769}},"urlEndpoint":{"url":"/timedtext_video?ref=watch\u0026v=QyeBxcvUJIU"}}}]},"noSubtitlesText":{"simpleText":"This video doesn't have subtitles or closed captions yet."},"promoSubtitlesText":{"simpleText":"Help this video reach more people by contributing subtitles or closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"QyeBxcvUJIU","title":"The New Silk Road, Part 2: From Kyrgyzstan to Duisburg | DW Documentary","lengthSeconds":"2546","keywords":["Documentary","Documentaries","documentaries","DW documentary","DW documentary 2019","full documentary","documentary 2019","DW","beyond the news","New Silk Road","China","Kyrgyzstan","Oman","Europe","belt and road","belt and road documentary","central asia","belt and road documentary 2019","kyrgyzstan","duisburg","oman","marseille","international trade","international trade documentary"],"channelId":"UCW39zufHfsuGgpLviKh297Q","isOwnerViewing":false,"shortDescription":"The New Silk Road is a mammoth project meant to connect China with the West. It’s a gigantic infrastructure project that Beijing says will benefit all. But this two-part documentary shows another side: of China’s self-interest and geopolitical ambitions.\n\nChina's path to global power leads through the legendary trade road. Our authors travel west on two separate paths: One team follows the sea route, along which China is expanding its support bases, while the other follows the ancient Silk Road through Central Asia. Their journey takes them through stunning landscapes and to magical places with ancient caravanserais, where the lore of the old Silk Road lives on. At the same time, they observe China’s overwhelming new influence in immense construction sites and shipping hubs. People everywhere are hoping the new trade will bring them and their children work and prosperity, just as the old Silk Road did hundreds of years ago. But others fear that a future dominated by China will bring them no good at all. \"Clean water, the mountains and nature are much more important than the money they give us,\" the filmmakers learn in Kyrgyzstan. Chinese investment has not only bestowed the country with better roads, power lines and railway lines, but also with environmental pollution, corruption and crippling debt. Oman is another stop on the line, where Beijing has taken over large parts of a new Special Economic Zone in the desert city of Duqm. You can still see traditional Arab dhows in the old harbor at Sur, but they no longer have a place in today’s international trade. Instead, the horizon is dotted with huge container ships, many of them flying the Chinese flag. Meanwhile, the French port city of Marseille is aiming to become the New Silk Road’s European bridgehead. A small container village in the hills above the city is the first step. Cheap textiles from the Far East are delivered here to the \"Marseille International Fashion Center”. MIF 68 for short - 68 is considered a lucky number in China - is geared towards distributing China’s products throughout Europe. The two-part documentary shows the breathtaking dimensions of this gigantic project - one where, it would seem, no stone will be left unturned.\n\n--------------------------------------------------------------------\n\nDW Documentary gives you knowledge beyond the headlines. Watch high-class documentaries from German broadcasters and international production companies. Meet intriguing people, travel to distant lands, get a look behind the complexities of daily life and build a deeper understanding of current affairs and global events. Subscribe and explore the world around you with DW Documentary.\n\nSubscribe t lines and railway lines, but also with environmental pollution, corruption and crippling debt. Oman is another stop on the line, where Beijing has taken over large parts of a new Special Economic Zone in the desert city of Duqm. You can still see traditional Arab dhows in the old harbor at Sur, but they no longer have a place in today’s international trade. Instead, the horizon is dotted with huge container ships, many of them flying the Chinese flag. Meanwhile, the French port city of Marseille is aiming to become the New Silk Road’s European bridgehead. A small container village in the hills above the city is the first step. Cheap textiles from the Far East are delivered here to the \"Marseille International Fashion Center”. MIF 68 for short - 68 is considered a lucky number in China - is geared towards distributing China’s products throughout Europe. The two-part documentary shows the breathtaking dimensions of this gigantic project - one where, it would seem, no stone will be left unturned.\n\n--------------------------------------------------------------------\n\nDW Documentary gives you knowledge beyond the headlines. Watch high-class documentaries from German broadcasters and international production companies. Meet intriguing people, travel to distant lands, get a look behind the complexities of daily life and build a deeper understanding of current affairs and global events. Subscribe and explore the world around you with DW Documentary.\n\nSubscribe to DW Documentary:\nhttps://www.youtube.com/channel/UCW39zufHfsuGgpLviKh297Q?sub_confirmation=1#\n\nOur other YouTube channels:\nDW Documental (in spanish):  https://www.youtube.com/dwdocumental\nDW Documentary وثائقية دي دبليو: (in arabic): https://www.youtube.com/dwdocarabia\n\nFor more documentaries visit also:\nhttp://www.dw.com/en/tv/docfilm/s-3610\nInstagram\nhttps://www.instagram.com/dwdocumentary/\nFacebook:\nhttps://www.facebook.com/dw.stories\n\nDW netiquette policy: https://p.dw.com/p/MF1G"},"lengthS
